"use strict";function verifyCbx(e){document.getElementById("inputCbx").checked||e.abort()}function verifyIfMontoIsFloat(e){var t=document.getElementById("inputMonto").value;if(isFloat(t)){var n=document.getElementById("monto-error");n.classList.contains("d-none")||n.classList.add("d-none")}else{var o=document.getElementById("monto-error");o.classList.contains("d-none")&&o.classList.remove("d-none"),e.abort()}}function verifyIfCodeIsInteger(e){var t=document.getElementById("inputCode").value;if(isInteger(t)){var n=document.getElementById("code-error");n.classList.contains("d-none")||n.classList.add("d-none")}else{var o=document.getElementById("code-error");o.classList.contains("d-none")&&o.classList.remove("d-none"),e.abort()}}$("#form_pay").bind("submit",function(){return $.ajax({type:$(this).attr("method"),url:$(this).attr("action"),data:$(this).serialize(),beforeSend:function(e){verifyCbx(e),verifyIfCodeIsInteger(e),verifyIfMontoIsFloat(e)},success:function(e){alert("suceess")},error:function(){alert("error")}}),!1});